import React from "react";
import PropTypes from 'prop-types';

const AuthLayout = (props) => {
    return (
      <div className="auth-layout">
        {props.children}
      </div>
    );
}

AuthLayout.prototype = {
    props: PropTypes.node.isRequired
}

export default AuthLayout;
